        insert.add("insert into ARTICULOS (IDARTICULO, IDPARTIDA, IDMARCA, NOMBRE, DESCRIPCION, USO, OBSERVACIONES, IDREFERENCIA, NACIONALIDAD, CODVIEJO, UNIDADVENTA_COMERCIAL, EMPAQUE_COMERCIAL) values (1160587, 1004299, 1009670, 'DESENGRASANTE PROF 1 GALON DISORCA', 'HERRAMIENTA PROFESIONAL BIODEGRADABLE DISEÑADA PARA LA LIMPIEZA DE MOTORES Y SALAS DE MÁQUINA. NO ALTERA LA PINTURA, NI RESECA LAS GOMAS O PLATINAS. LA SUPERFICIE QUEDA TOTALMENTE LIBRE DE GRASA Y SUCIO PERMANECIENDO LIMPIA POR MÁS TIEMPO. ', 'EL PRODUCTO DEBE SER APLICADO MEDIANTE UN SPRAY MANUAL O DE PRESION POSITIVA (DEBE EVITARSE EL USO DE COMPRESORES Y PISTOLAS YA QUE LOS GASES SON IRRITANTES DEL SISTEMA RESPIRATORIO Y DE LAS MUCOSAS DE LOS OJOS). DEJAR ACTUAR DE 5 A 15 MINUTOS Y LAVAR CON PRESIÓN ', 'RENDIMIENTO 1 GALÓN PUEDE LAVAR HASTA 3 MOTORES DE CARRO.', 'T4007', 'NACIONAL', '2500036', 4, 'CJA')".replaceAll("\\s+", " ").trim());
        insert.add("insert into ARTICULOS (IDARTICULO, IDPARTIDA, IDMARCA, NOMBRE, DESCRIPCION, USO, OBSERVACIONES, IDREFERENCIA, NACIONALIDAD, CODVIEJO, UNIDADVENTA_COMERCIAL, EMPAQUE_COMERCIAL) values (1160588, 1004299, 1009670, 'LIMPIADOR DE TAPICERIAS 1 GALON DISORCA', 'HERRAMIENTA CONCENTRADA DISEÑADA PARA LA LIMPIEZA DE TAPICERÍAS Y ALFOMBRAS. SUS DETERGENTES Y LA PRESENCIA DE SOLVENTES EN LA FORMULA LO HACE UNA HERRAMIENTA PODEROSA PARA DICHOS FINES', 'MEZCLE UN (1) LITRO DEL PRODUCTO CON DOS (2) LITROS DE AGUA. PARA ÁREAS PEQUEÑAS USE UN CEPILLO DE CERDAS PLÁSTICAS SUAVE, MÓJELO EN EL PRODUCTO Y CEPILLE EL ÁREA CON MOVIMIENTOS CIRCULARES, LUEGO SEQUE CON UN PAÑO ABSORBENTE LIMPIO Y SECO. ', 'RENDIMIENTO 1 GALÓN PUEDE LIMPIAR HASTA 40 METROS CUADRADOS.', 'T4008', 'NACIONAL', '2500038', 4, 'CJA')".replaceAll("\\s+", " ").trim());
        insert.add("insert into ARTICULOS (IDARTICULO, IDPARTIDA, IDMARCA, NOMBRE, DESCRIPCION, USO, OBSERVACIONES, IDREFERENCIA, NACIONALIDAD, CODVIEJO, UNIDADVENTA_COMERCIAL, EMPAQUE_COMERCIAL) values (1160589, 1004299, 1009670, 'LIMPIADOR SUPERF/GRASA 1 GALON DISORCA', 'HERRAMIENTA BIODEGRADABLE DISEÑADA PARA LA LIMPIEZA DE ÁREAS TALES COMO ESTACIONAMIENTOS, PISOS DE RESTAURANTES, PANADERÍAS, TALLERES MECÁNICOS, ESTACIONES DE SERVICIO, MUELLES DE DESCARGA, PISOS INDUSTRIALES, ETC, QUE SE ENCUENTREN SUCIOS DE GRASA', 'DEBE SER APLICADA MEDIANTE UN SPRAY MANUAL O DE PRESIÓN POSITIVA (DEBE EVITARSE EL USO DE COMPRESORES Y PISTOLAS YA QUE LOS GASES SON IRRITANTES DEL SISTEMA RESPIRATORIO Y DE LAS MUCOSAS DE LOS OJOS). DEJAR ACTUAR DE 5 A 15 MINUTOS, APLICAR NUEVAMENTE PRODUCTO Y C', 'RENDIMIENTO 1 GALÓN PUEDE LAVAR HASTA 30 METROS CUADRADOS', 'T4009', 'NACIONAL', '2500040', 4, 'CJA')".replaceAll("\\s+", " ").trim());
